import React, { useEffect, useState } from "react";

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

import { useNavigate } from 'react-router-dom'
import axios from "axios";

//https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist

function Home() {

  const navigate = useNavigate()

  const [users, setUsers] = useState()

  useEffect(() => {
    const dataRegister = JSON.parse(localStorage.getItem("dataRegister"))
    if (!dataRegister) {
      navigate('register')
    }
  }, [])

  useEffect(() => {
    const res = axios.get("https://649cf38a9bac4a8e669d1b36.mockapi.io/todolist")
    res.then((data) => setUsers(data.data))
  }, [])

  console.log('============= users', users)

  return (<TableContainer component={Paper}>
    <Table sx={{ width: "80%" }} aria-label="simple table">
      <TableHead>
        <TableRow>
          <TableCell>FristName</TableCell>
          <TableCell align="right">Calories</TableCell>
          <TableCell align="right">Fat&nbsp;(g)</TableCell>
          <TableCell align="right">Carbs&nbsp;(g)</TableCell>
          <TableCell align="right">Protein&nbsp;(g)</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {users && users.map((user) => (
          <TableRow
            key={user.id}
            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
          >
            <TableCell component="th" scope="row">
              {user.fristName}
            </TableCell>
            <TableCell align="right">{user.lastName}</TableCell>
            <TableCell align="right">{user.age}</TableCell>
            <TableCell align="right">{user.email}</TableCell>
            <TableCell align="right">{user.address}</TableCell>
          </TableRow>
        ))}
      </TableBody>
    </Table>
  </TableContainer>)
}

export default Home;
